            <h2 class=""post-title custom-font-1"">FAQ & support</h2>
            <h5 class=""custom-font-1"">Dropdown menu</h5>
            <p>To create a dropdown menu, first decide on which menu item in your Main Menu you would like to have as a dropdown. From the Navigation tab in the Shopify Admin, create a new ""link list"". The title of this ""link list"" must be the same as the title of the menu item from your Main Menu. For example, if you have a Main Menu with a link called ""Collections"", create a new ""link list"" with the title ""Collections"". Each link in this new ""link list"" will appear as a dropdown under ""Collections"".<br /></p>
            <p>As always, if you have any problems or questions regarding our themes, you can write to our support at&nbsp;<a href=""mailto:support@plan");
            WriteLiteral(@"etshine.net""><b>support@planetshine.net</b></a>&nbsp;We will try to answer as soon as humanly possible!<br /></p>

            <h5 class=""custom-font-1"">Homepage slideshow</h5>
            <p>You can setup homepage slideshow in theme settings page under the ""Homepage Slider"" tab. You can have at max 5 slides, whom you can enable one by one using checkboxes given. Each slide can display either a text or a price tag. You can select type using select box ""description type"".</p>

            <h5 class=""custom-font-1"">Adding ""SALE"" icon to products</h5>
